import collections, heapq

class Graph():
    def __init__(self, nodes, edges):
        self.nodes = nodes
        # Lookup table data structure:
        self.G = collections.defaultdict(lambda: [False,False,[],[]]) # Explored (bool), Added to queue, array of distances, array of outgoing edges
        for edge in edges:
            # edge: [from, to, distance]
            self.G[edge[0]][3].append(edge[1])
            self.G[edge[0]][2].append(edge[2])
    def dijkstra(self, S):
        queue = [(0, S)]
        A = collections.defaultdict(lambda: float('inf')); A[S] = 0; B = collections.defaultdict(list); B[S] = [S]
        while queue:
            S_d, S = heapq.heappop(queue)
            if self.G[S][0]: continue # seen before

            self.G[S][0] = True;# print("Source node:",S)
            for index, V in enumerate(self.G[S][3]): 
                if not self.G[V][0]:
                    d = self.G[S][2][index]
                    heapq.heappush(queue, (A[S]+d, V)) 
                    #print(A[V], A[S], d)
                    if A[V] > A[S] + d:
                        A[V] = A[S] + d
                        B[V] = B[S] + [V]
        return A, B
